schema.example:
{
    "swagger": "2.0",
    "info": {
        "description": "La estandarizacin de la conexin con cualquier banco en tiempo real.",
        "version": "3.0.0",
        "title": "AfterbanksTest",
        "x-apisguru-categories": [
            "financial"
        ],
        "x-description-language": "es",
        "x-logo": {
            "backgroundColor": "#FFFFFF",
            "url": "https://pbs.twimg.com/profile_images/910891773521793030/0Uehp4Yx_400x400.jpg"
        },
        "x-origin": [
            {
                "format": "swagger",
                "url": "https://www.afterbanks.com/api/documentation/es/swagger.yaml",
                "version": "2.0"
            }
        ],
        "x-providerName": "afterbanks.com",
        "x-preferred": true
    },
    "host": "www.afterbanks.com",
    "basePath": "/",
    "schemes": [
        "https"
    ],
    "produces": [
        "application/json"
    ],
    "paths": {
        "/forms": {
            "get": {
                "tags": [
                    "forms"
                ],
                "summary": "Lista de bancos soportados",
                "description": "Obtn una lista completa de los bancos soportados, as como los nombres de los campos necesarios para dibujar un formulario de login similar al oritinal del banco.\n",
                "parameters": [
                    {
                        "name": "country_code",
                        "in": "query",
                        "description": "Cdigo del pas, formato ISO 3166-1 alpha-2 (https://en.wikipedia.org/wiki/ISO_3166-1_alpha-2). Por ejemplo ES para Espaa. Si no se proporciona ningn cdigo, se devolver la lista completa.",
                        "required": false,
                        "type": "string"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Array con el listado de bancos soportados y la informacin necesaria para dibujar su formulario de login",
                        "schema": {
                            "type": "array",
                            "items": {
                                "$ref": "#/definitions/Forms"
                            }
                        }
                    },
                    "default": {
                        "description": "Unexpected error",
                        "schema": {
                            "$ref": "#/definitions/Error"
                        }
                    }
                }
            }
        },
        "/me": {
            "post": {
                "tags": [
                    "User"
                ],
                "summary": "Informacin de uso de mi licencia",
                "description": "Devuelve informacin sobre mi licencia y uso de llamadas",
                "parameters": [
                    {
                        "name": "servicekey",
                        "in": "query",
                        "description": "Licencia que identifica al cliente. Si no tienes una, puedes solicitarla en https://www.afterbanks.com",
                        "required": true,
                        "type": "string"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Profile information for a user",
                        "schema": {
                            "$ref": "#/definitions/me"
                        }
                    },
                    "default": {
                        "description": "Unexpected error",
                        "schema": {
                            "$ref": "#/definitions/Error"
                        }
                    }
                }
            }
        },
        "/serviceV3": {
            "post": {
                "tags": [
                    "serviceV3"
                ],
                "summary": "Posicin global y movimientos hasta una fecha dada.",
                "description": "Este endpoint devuelve el listado de productos y los movimientos para cada uno de los productos desde la fecha solicidata hasta el da actual. Existe un sandbox donde probar llamadas: https://www.afterbanks.com/sandbox/\n",
                "parameters": [
                    {
                        "name": "servicekey",
                        "in": "query",
                        "description": "Licencia que identifica al cliente. Si no tienes una, puedes solicitarla en https://www.afterbanks.com",
                        "required": true,
                        "type": "string"
                    },
                    {
                        "name": "service",
                        "in": "query",
                        "description": "Identificador nico para cada banco. El listado de bancos soportados se obtiene de https://www.afterbanks.com/forms/",
                        "required": true,
                        "type": "string"
                    },
                    {
                        "name": "documentType",
                        "in": "query",
                        "description": "Algunos bancos, en su formulario de login, solicitan el tipo de documento. En estos casos, se deber identificar un nmero entero (de 0 a 4), que corresponde con su posicin en el formulario de login del banco.",
                        "required": false,
                        "type": "number",
                        "format": "int32"
                    },
                    {
                        "name": "user",
                        "in": "query",
                        "description": "Usuario",
                        "required": true,
                        "type": "string"
                    },
                    {
                        "name": "pass",
                        "in": "query",
                        "description": "Contrasea",
                        "required": true,
                        "type": "string"
                    },
                    {
                        "name": "pass2",
                        "in": "query",
                        "description": "Algunos bancos utilizan una segunda contrasea.",
                        "required": false,
                        "type": "string"
                    },
                    {
                        "name": "products",
                        "in": "query",
                        "description": "Nombres de productos bancarios (cuentas corrientes, tarjetas, etc), separados por coma. Cabe destacar que en la primera llamada a la API, an no conocemos los nombres de los productos que el usuario tiene contratados, por lo que este parmetro estar vaco.",
                        "required": false,
                        "type": "string"
                    },
                    {
                        "name": "startdate",
                        "in": "query",
                        "description": "Fecha desde la que queremos obtener los movimientos en formato dd-mm-aaaa. Obligatorio cuando el valor de \"products\" es distinto de GLOBAL.",
                        "required": true,
                        "type": "string"
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Array con listado de productos bancarios y movimientos.",
                        "schema": {
                            "type": "array",
                            "items": {
                                "$ref": "#/definitions/serviceV3"
                            }
                        }
                    },
                    "default": {
                        "description": "Unexpected error",
                        "schema": {
                            "$ref": "#/definitions/Error"
                        }
                    }
                }
            }
        }
    },
    "definitions": {
        "Error": {
            "type": "object",
            "properties": {
                "code": {
                    "type": "integer",
                    "format": "int32",
                    "description": "Posibles valores: description:  1, Genrico; 2, La web del banco esta fuera de servicio; 3, Algn dato de conexin no es vlido; 4, La cuenta solicitada no existe; 5, Conexion cortada, reintente la solicitud; 6, El usuario debe acceder a la web del banco a realizar una accin; 50, Parametro incorrecto en la llamada a la API"
                },
                "message": {
                    "type": "string",
                    "description": "Texto detallando el error encontrado, en el idioma del banco"
                }
            }
        },
        "Forms": {
            "type": "object",
            "properties": {
                "business": {
                    "type": "boolean",
                    "description": "Valor booleano. Hay bancos que tienen accesos diferentes para particulares y para empresas. Si el valor es 1, indica que es acceso de empresas"
                },
                "country_code": {
                    "type": "string",
                    "description": "Cdigo del pas, formato ISO 3166-1 alpha-2 (https://en.wikipedia.org/wiki/ISO_3166-1_alpha-2)."
                },
                "documentType": {
                    "type": "string",
                    "description": "Lista de valores posibles para el campo de \"tipo de documento\", separado por el caracter \"|\" (por ejemplo: NIF|Pasaporte|Tarjeta de residencia). En el caso de que el banco no requiera de esta informacin en su formulario de login, el valor es 0"
                },
                "fullname": {
                    "type": "string",
                    "description": "Nombre completo del banco."
                },
                "image": {
                    "type": "string",
                    "description": "URL del icono del banco en formato PNG transparente y resolucin 128x128."
                },
                "pass": {
                    "type": "string",
                    "description": "Texto que acompaa al input box de password"
                },
                "pass2": {
                    "type": "string",
                    "description": "Texto que acompaa al input box del segundo password. En el caso de que el banco no requiera de esta informacin en su formulario de login, el valor es 0"
                },
                "pass2desc": {
                    "type": "string",
                    "description": "Texto de ayuda para rellenar el inputbox de segundo password, en caso de que el formulario original del banco tenga algn texto de ayuda."
                },
                "pass2type": {
                    "type": "string",
                    "description": "Texto que acompaa al input box del segundo password. En el caso de que el banco no requiera de esta informacin en su formulario de login, el valor es 0"
                },
                "passdesc": {
                    "type": "string",
                    "description": "Texto de ayuda para rellenar el inputbox de password, en caso de que el formulario original del banco tenga algn texto de ayuda."
                },
                "passtype": {
                    "type": "string",
                    "description": "Texto que acompaa al input box de password"
                },
                "service": {
                    "type": "string",
                    "description": "Identificador nico del banco en la API."
                },
                "swift": {
                    "type": "string",
                    "description": "Cdigo SWIFT, formato ISO 9362 (https://en.wikipedia.org/wiki/ISO_9362)."
                },
                "user": {
                    "type": "string",
                    "description": "Texto que acompaa al input box de usuario"
                },
                "userdesc": {
                    "type": "string",
                    "description": "Texto de ayuda para rellenar el inputbox de usuario, en caso de que el formulario original del banco tenga algn texto de ayuda."
                },
                "usertype": {
                    "type": "string",
                    "description": "Texto que acompaa al input box de usuario"
                }
            }
        },
        "Transactions": {
            "type": "object",
            "properties": {
                "amount": {
                    "type": "number",
                    "format": "float",
                    "description": "Importe de la transaccin"
                },
                "balance": {
                    "type": "number",
                    "format": "float",
                    "description": "Saldo del producto en el instante posterior a la transaccin"
                },
                "categoryId": {
                    "type": "number",
                    "format": "int",
                    "description": "Id de categora. Solo para las servicekeys con la opcin contratada. Listado de categoras: https://www.afterbanks.com/serviceV3/categories/?country_code=ES"
                },
                "date": {
                    "type": "string",
                    "format": "date",
                    "description": "Fecha del movimiento en formato dd-mm-yyyy"
                },
                "date2": {
                    "type": "string",
                    "format": "date",
                    "description": "Fecha de valor en formato dd-mm-yyyy"
                },
                "description": {
                    "type": "string",
                    "description": "Descricipcin de la transaccin"
                },
                "transactionId": {
                    "type": "string",
                    "description": "Identificador nico de la transaccin de 32 caracteres"
                }
            }
        },
        "me": {
            "type": "object",
            "properties": {
                "date_renewal": {
                    "type": "string",
                    "format": "date",
                    "description": "Fecha de renovacin del contador de llamadas, en formato dd-mm-yyyy"
                },
                "remaining_calls": {
                    "type": "integer",
                    "format": "int32",
                    "description": "Llamadas restantes para tu ciclo de facturacin actual."
                }
            }
        },
        "serviceV3": {
            "type": "object",
            "properties": {
                "arranged_balance": {
                    "type": "number",
                    "format": "float",
                    "description": "Saldo dispuesto"
                },
                "balance": {
                    "type": "number",
                    "format": "float",
                    "description": "Saldo disponible del producto. Siempre existir este saldo, el resto de valores balance podrn existir o no."
                },
                "balance_credit_granted": {
                    "type": "number",
                    "format": "float",
                    "description": "Saldo concedido"
                },
                "balance_value": {
                    "type": "number",
                    "format": "float",
                    "description": "Saldo valor"
                },
                "countable_balance": {
                    "type": "number",
                    "format": "float",
                    "description": "Saldo contable"
                },
                "currency": {
                    "type": "string",
                    "description": "Cdigo de la divisa en formato [ISO 4217](http://en.wikipedia.org/wiki/ISO_4217)."
                },
                "description": {
                    "type": "string",
                    "description": "Nombre del producto. En ocasiones es un alias que ha asignado el usuario, o puede coincidir con el valor de product."
                },
                "product": {
                    "type": "string",
                    "description": "Identificador nico para un producto. Por ejemplo, nmero de cuenta bancaria o numeracin de tarjeta de crdito."
                },
                "transactions": {
                    "type": "array",
                    "items": {
                        "$ref": "#/definitions/Transactions"
                    }
                },
                "type": {
                    "type": "string",
                    "description": "Tipo de producto. Los valores ms habituales son \"checking\" para cuenta corriente, \"card\" para tarjeta de crdito, \"debit\" para tarjeta de dbito y \"loan\" para prstamos. Los valores posibles son: card, checking, debit, deposit, insurance, investment, lineofcredit, loan, other, pensionplan, saving, securities, stocks"
                }
            }
        },
        "effectivePeriod": {
            "type": "object",
            "required": [
                "startTime"
            ],
            "properties": {
                "startTime": {
                    "type": "string",
                    "description": "startTime child element"
                }
            }
        },
        "cardHolderAddress": {
            "type": "object",
            "required": [
                "postalCode"
            ],
            "properties": {
                "postalCode": {
                    "type": "string",
                    "description": "PostalCode String"
                }
            }
        },
        "BillingArrangement": {
            "type": "object",
            "properties": {
                "payChannel": {
                    "$ref": "#/definitions/payChannel"
                }
            }
        },
        "paymentInstrument": {
            "type": "object",
            "properties": {
                "creditCard": {
                    "$ref": "#/definitions/creditCard"
                },
                "cardHolderAddress": {
                    "$ref": "#/definitions/cardHolderAddress"
                }
            }
        },
        "autoRefillStatus": {
            "type": "object",
            "required": [
                "cardType",
                "orderId"
            ],
            "properties": {
                "@id": {
                    "type": "string"
                },
                "account": {
                    "type": "array",
                    "items": {
                        "$ref": "#/definitions/account"
                    }
                },
                "orderId": {
                    "type": "string",
                    "description": "Uniquely identifies the order being adjusted."
                },
                "BillingArrangement": {
                    "$ref": "#/definitions/BillingArrangement"
                },
                "paymentTransaction": {
                    "$ref": "#/definitions/paymentTransaction"
                },
                "cardType": {
                    "type": "string",
                    "description": "cardType string type"
                },
                "carrierRoute": {
                    "type": "string",
                    "description": "The postal carrier route code identifies a group of addresses within a single ZIP code to aid in sorting mail for delivery. The code consists of a letter followed by 3 digits.",
                    "pattern": "[A-Z]{1}[0-9]{3}"
                },
                "deliveryPointCode": {
                    "type": "string",
                    "description": "A three digit field used in CASS (Coding Accuracy Support System) along with ZIP, ZIP+4 and CRRT Code to automate the postal sortation process and maximize postage discounts. First two digits identify a unique delivery point. Third digit is a check digit.",
                    "minLength": 2,
                    "maxLength": 3,
                    "pattern": "[0-9]{3}"
                },
                "PortActionCode": {
                    "type": "string",
                    "description": "The action code defines what should be done with the port in request.                      "
                }
            },
            "description": "AutoRefilStatus"
        },
        "creditCardPayment": {
            "type": "object",
            "properties": {
                "creditCard": {
                    "$ref": "#/definitions/creditCard"
                }
            }
        },
        "contact": {
            "type": "object",
            "properties": {
                "emailCommunication": {
                    "$ref": "#/definitions/emailCommunication"
                }
            }
        },
        "debitCard": {
            "type": "object",
            "required": [
                "cardHolderName"
            ],
            "properties": {
                "cardHolderName": {
                    "type": "string",
                    "description": "cardHolderName string type"
                }
            }
        },
        "payChannel": {
            "type": "object",
            "properties": {
                "effectivePeriod": {
                    "$ref": "#/definitions/effectivePeriod"
                },
                "contact": {
                    "$ref": "#/definitions/contact"
                },
                "paymentInstrument": {
                    "$ref": "#/definitions/paymentInstrument"
                }
            }
        },
        "emailCommunication": {
            "type": "object",
            "required": [
                "emailAddress"
            ],
            "properties": {
                "emailAddress": {
                    "type": "string",
                    "description": "Email Address Simple type element"
                }
            }
        },
        "creditCard": {
            "type": "object",
            "required": [
                "cardHolderName"
            ],
            "properties": {
                "cardNumber": {
                    "$ref": "#/definitions/cardNumber"
                },
                "cardHolderName": {
                    "type": "string",
                    "description": "cardHolderName string type"
                }
            }
        },
        "paymentTransaction": {
            "type": "object",
            "required": [
                "paymentTransactionId"
            ],
            "properties": {
                "paymentTransactionId": {
                    "type": "string",
                    "description": "paymentTransactionId string type"
                },
                "creditCardPayment": {
                    "$ref": "#/definitions/creditCardPayment"
                },
                "debitCardPayments": {
                    "$ref": "#/definitions/debitCardPayments"
                }
            }
        },
        "account": {
            "type": "object",
            "properties": {
                "customerId": {
                    "type": "string"
                }
            }
        },
        "cardNumber": {
            "type": "object",
            "properties": {
                "@maskingType": {
                    "type": "string",
                    "description": "Masking type attribute element"
                }
            }
        },
        "debitCardPayments": {
            "type": "object",
            "properties": {
                "debitCard": {
                    "$ref": "#/definitions/debitCard"
                }
            }
        }
    }
}

{
    "swagger": "2.0",
    "info": {
        "description": "Swagger for Payment Initiation API Specification",
        "version": "v3.1.3",
        "title": "Payment Initiation API",
        "termsOfService": "https://www.openbanking.org.uk/terms",
        "contact": {
            "name": "Service Desk",
            "email": "ServiceDesk@openbanking.org.uk"
        },
        "license": {
            "name": "open-licence",
            "url": "https://www.openbanking.org.uk/open-licence"
        }
    },
    "host": "openbanking.api.com",
    "basePath": "/open-banking/v3.1/pisp",
    "tags": [
        {
            "name": "Payments Check",
            "description": "Payments"
        },
        {
            "name": "Scheduled Payment",
            "description": "Scheduled Payment"
        },
        {
            "name": "Standing Order Consents",
            "description": "Standing Order Consents"
        },
        {
            "name": "Payment Type",
            "description": "Payment Type"
        }
    ],
    "schemes": [
        "https"
    ],
    "consumes": [
        "application/json; charset=utf-8"
    ],
    "produces": [
        "application/json; charset=utf-8"
    ],
    "paths": {
        "/domestic-payment-consents": {
            "post": {
                "tags": [
                    "Domestic Payments"
                ],
                "summary": "Create Domestic Payment Consents",
                "operationId": "CreateDomesticPaymentConsents",
                "parameters": [
                    {
                        "in": "body",
                        "name": "OBWriteDomesticConsent2Param",
                        "description": "Default",
                        "required": true,
                        "schema": {
                            "$ref": "#/definitions/OBWriteDomesticConsent2"
                        }
                    },
                    {
                        "name": "x-fapi-financial-id",
                        "in": "header",
                        "description": "The unique id of the ASPSP to which the request is issued. The unique id will be issued by OB.",
                        "required": true,
                        "type": "string"
                    },
                    {
                        "name": "x-fapi-customer-last-logged-time",
                        "in": "header",
                        "description": "The time when the PSU last logged in with the TPP. \nAll dates in the HTTP headers are represented as RFC 7231 Full Dates. An example is below: \nSun, 10 Sep 2017 19:43:31 UTC",
                        "required": false,
                        "type": "string",
                        "pattern": "^(Mon|Tue|Wed|Thu|Fri|Sat|Sun), \\d{2} (Jan|Feb|Mar|Apr|May|Jun|Jul|Aug|Sep|Oct|Nov|Dec) \\d{4} \\d{2}:\\d{2}:\\d{2} (GMT|UTC)$"
                    },
                    {
                        "name": "x-fapi-customer-ip-address",
                        "in": "header",
                        "description": "The PSU's IP address if the PSU is currently logged in with the TPP.",
                        "required": false,
                        "type": "string"
                    },
                    {
                        "name": "x-fapi-interaction-id",
                        "in": "header",
                        "description": "An RFC4122 UID used as a correlation id.",
                        "required": false,
                        "type": "string"
                    },
                    {
                        "name": "Authorization",
                        "in": "header",
                        "description": "An Authorisation Token as per https://tools.ietf.org/html/rfc6750",
                        "required": true,
                        "type": "string"
                    },
                    {
                        "name": "x-idempotency-key",
                        "in": "query",
                        "description": "Every request will be processed only once per x-idempotency-key.  The Idempotency Key will be valid for 24 hours.",
                        "required": true,
                        "type": "string",
                        "maxLength": 40,
                        "pattern": "^(?!\\s)(.*)(\\S)$"
                    },
                    {
                        "name": "x-jws-signature",
                        "in": "header",
                        "description": "A detached JWS signature of the body of the payload.",
                        "required": true,
                        "type": "string"
                    },
                    {
                        "name": "x-customer-user-agent",
                        "in": "header",
                        "description": "Indicates the user-agent that the PSU is using.",
                        "required": false,
                        "type": "string"
                    }
                ],
                "responses": {
                    "201": {
                        "description": "Domestic Payment Consents Created",
                        "schema": {
                            "$ref": "#/definitions/OBWriteDomesticConsentResponse2"
                        },
                        "headers": {
                            "x-fapi-interaction-id": {
                                "type": "string",
                                "description": "An RFC4122 UID used as a correlation id."
                            },
                            "x-jws-signature": {
                                "type": "string",
                                "description": "Header containing a detached JWS signature of the body of the payload."
                            }
                        }
                    },
                    "400": {
                        "description": "Bad request",
                        "schema": {
                            "$ref": "#/definitions/OBErrorResponse1"
                        }
                    },
                    "401": {
                        "description": "Unauthorized"
                    },
                    "403": {
                        "description": "Forbidden"
                    },
                    "405": {
                        "description": "Method Not Allowed"
                    },
                    "406": {
                        "description": "Not Acceptable"
                    },
                    "415": {
                        "description": "Unsupported Media Type"
                    },
                    "429": {
                        "description": "Too Many Requests",
                        "headers": {
                            "Retry-After": {
                                "type": "integer",
                                "description": "Number in seconds to wait"
                            }
                        }
                    },
                    "500": {
                        "description": "Internal Server Error",
                        "schema": {
                            "$ref": "#/definitions/OBErrorResponse1"
                        }
                    }
                },
                "security": [
                    {
                        "TPPOAuth2Security": [
                            "payments"
                        ]
                    }
                ]
            }
        },
        "/domestic-payment-consents/{ConsentId}": {
            "get": {
                "tags": [
                    "Domestic Payments"
                ],
                "summary": "Get Domestic Payment Consents",
                "operationId": "GetDomesticPaymentConsentsConsentId",
                "parameters": [
                    {
                        "name": "ConsentId",
                        "in": "path",
                        "description": "ConsentId",
                        "required": true,
                        "type": "string"
                    },
                    {
                        "name": "x-fapi-financial-id",
                        "in": "header",
                        "description": "The unique id of the ASPSP to which the request is issued. The unique id will be issued by OB.",
                        "required": true,
                        "type": "string"
                    },
                    {
